function Nav() {
  return (
    <nav className="nav">
      <ul className="menu">
        <li>Collections</li>
        <li>Men</li>
        <li>Women</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
      <img src=".\images\logo.svg" alt="logo"/>
    </nav>
  );
}

export default Nav;
